import React from "react";
import Grid from "@material-ui/core/Grid";

import Product from './Product/Product';

const products = [
    { id: 1, name: "T-Shirt", description: "Signature Visten T-shirt. 100% cotton.", price: "$20", image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fshopmouthbreather.com%2Fproduct%2Fmouthbreather-white-tee%2F&psig=AOvVaw0g_s87z6h6OK2-tKVs7zjM&ust=1627619091992000&source=images&cd=vfe&ved=0CAkQjhxqFwoTCMDP3uC3h_ICFQAAAAAdAAAAABAE" },
    { id: 2, name: "Hoodie", description: "Signature Visten embroidered sweatshirt. Only the finest tailoring...", price: "$900", image: "https://thumbs.dreamstime.com/b/blank-hoodie-sweatshirt-color-black-back-view-spread-out-white-background-98229804.jpg" }
]



const Products = () => {
    return (
        <div>
            <main>
                <Grid container justify="center" spacing={4}>
                    {products.map((product) => (
                        < Grid item key={product.id} xs={12} sm={6} md={4} lg={3} > {/* xs = {12} means for mobile devices, grid takes up whole screen. sm, md and lg mean the same thing for larger devices respectively with 6/12 representing half the screen as an example*/}
                            < Product product={product} />
                        </ Grid>
                    ))}
                </Grid>

            </main>
        </div >

    );
}

export default Products;
